        private float CalculatePrice(float gmPrice, float price, float fusePrice)
        {
            float overridePrice = price;
            float priceDiff = gmPrice - price;
            float moreThan90 = 1;
            if(price < 90)
                moreThan90 = 1;
            else
                moreThan90 = 0.5f;
            
            if (priceDiff >= 0)
            {
                if (priceDiff < 5)
                {
                    if (priceDiff < 3)
                    {
                        if (priceDiff < 2)
                        {
                            if (priceDiff < 1)
                                overridePrice = fusePrice - priceDiff * 0.97f;
                            else
                                overridePrice = fusePrice - priceDiff * 0.94f;
                        }
                        else
                            overridePrice = fusePrice - priceDiff * 0.62f;
                    }
                    else
                        overridePrice = fusePrice - priceDiff * 0.57f;
                }
                else
                    overridePrice = fusePrice - priceDiff * 0.51f;
            }
            else
            {
                if (Math.Abs(priceDiff) < 5)
                {
                    if (Math.Abs(priceDiff) < 3)
                        if (priceDiff > 1.5f)
                            overridePrice = fusePrice + priceDiff * 0.55f;
                        else
                            overridePrice = fusePrice + Math.Abs(priceDiff) * 0.3f;
                    else
                        overridePrice = fusePrice + Math.Abs(priceDiff) * 0.45f;
                    //overridePrice = fusePrice - priceDiff * gmPrice / fusePrice * 0.5f;
                }
                else
                    overridePrice = fusePrice + Math.Abs(priceDiff) * 0.3f;
            }

            if (price == 0 || gmPrice == 0 || fusePrice == 0)
                return 0;

            if (price > gmPrice && price - gmPrice < 1.5f && price - gmPrice > 0)
                return fusePrice;

            if (overridePrice < price * 0.5f || fusePrice - priceDiff * 1.5f < 10 || fusePrice <= 0)
                return price - price * 0.22f;

            return overridePrice;
        }

        //1  gm 156 price 60 
        //2  gm 66  price 60
        private float SetPrice(int day, float price, float gmPrice)
        {
            if (price == 0 || gmPrice == 0)
                return 0;

            return price - price * ProcAmount(day);
        }

        private float ProcAmount(int day)
        {
            float proc = 0;
            switch (day)
            {
                case 1:
                    proc = 0.39f;
                    break;
                case 2:
                    proc = 0.281f;
                    break;
                case 3:
                    proc = 0.30f;
                    break;
                case 4:
                    proc = 0.29f;
                    break;
                case 5:
                    proc = 0.28f;
                    break;
                case 6:
                    proc = 0.28f;
                    break;
                case 7:
                    proc = 0.28f;
                    break;
                default:
                    proc = 0.17f;
                    break;
            }
            return proc;
        }
        string SetDate(DateTime date)
        {
            return date.Year.ToString() + "-" + date.Month.ToString() + "-" + date.Day.ToString();
        }

        string SetJigRates(float price)
        {
            return price.ToString();
        }
